import React from 'react';
import HarmonyGenerator from '../components/HarmonyGenerator';

const Home = () => {
  return (
    <section className='page home-page'>
      <h3>Great news!</h3>
      <p>The harmonies generator BETA is live!</p>
      <p>Check it out below!</p>
      <HarmonyGenerator />
    </section>
  );
};

export default Home;
